INSERT INTO `matiere` (`id_matiere`, `semestre`, `is_option`, `nom`, `enseignant`, `heures`, `description`) VALUES
(1, 'S1', 0, 'Anglais 1', 'K. Helme', 30, 'Fournir aux √©tudiants les outils linguistiques n√©cessaires pour fonctionner efficacement dans l\'entreprise et avec leurs partenaires europ√©ens.\r\nExpression orale / √©crite : anglais des affaires, faire un compte rendu oral en public, r√©diger, lettres, rapports, r√©sum√© de conf√©rences, r√©unions.\r\nPr√©paration au TOEIC : Test of English for International Communication.\r\nTraduction Economique : Familiariser les √©tudiants avec la terminologie √©conomique √† partir de th√®mes d\'actualit√©. Travail en laboratoire et/ou en salle audiovisuelle √† partir de documents authentiques.'),
(3, 'S1', 0, 'Programmation Objet Avanc√©', 'E. N√©ou', 60, 'Introduction √† la programmation object avanc√©e.\r\nIntroduction. Rappels des concepts : classes, h√©ritage, interface, √©num√©rations, exceptions.\r\nD√©finition et utilisations des classes internes et anonymes\r\nApplication au traitement des collections.\r\nTypes param√©tr√©s et wildcards.\r\nTraitement des processus (thread). Introduction √† la programmation de t√¢ches s‚Äôex√©cutant en parall√®le. Gestion de ressources partag√©es entre processus.'),
(5, 'S1', 0, 'Intelligence Artificielle', 'S. Kornman', 45, 'Introduction aux outils et aux m√©thodes de r√©solution de l‚Äôintelligence artificielle.\r\n\r\n1) Apprentissage d\'un langage fonctionnel LISP ou Scheme.\r\n2) M√©thodes de r√©solution de probl√®mes : algorithmes de recherche dans un graphe d‚Äô√©tats.\r\n3) Jeux √† deux joueurs : mini-max et alpha-b√©ta.\r\n4) Syst√®mes Experts. Utilisation d‚Äôun g√©n√©rateur de syst√®mes experts. '),
(7, 'S1', 0, 'Introduction au Machine Learning', 'F. Yger', 45, 'Ce cours constitue une introduction √† l‚Äôapprentissage artificiel. Nous ferons des rappels de statistiques √©l√©mentaires et y aborderons les algorithmes fondamentaux d‚Äôapprentissage supervis√© et non supervis√©.\r\n1) apprentissage supervis√©:\r\nK-plus proches voisins,\r\nAnalyse discriminante lin√©aire et quadratique\r\nm√©thode bay√©sienne na√Øve,\r\nr√©gression logistique\r\n2) apprentissage non supervis√©:\r\nclassification hi√©rarchique,\r\nnu√©es dynamiques,\r\nmixtures de gaussiennes '),
(9, 'S1', 0, 'SGBD', 'K. Belhadjame', 60, 'L‚Äôobjectif de ce cours est de couvrir les techniques internes des syst√®mes de gestion de base de donn√©es (SGBD) qui sont responsables de l\'optimisation de l\'evaluation de requ√™tes SQL.\r\nUne partie importante de ces donn√©es sont structur√©es et la mani√®re dont nous y acc√©dons, les g√©rons et les traitons a un impact consid√©rable sur les performances et la fiabilit√© des applications manipulant les bases de donn√©es. La connaissance du mod√®le d\'entit√©s-associations, du modele relationnelle, de l\'alg√®bre relationnelle et du langage de requ√™te SQL n\'est en aucun cas suffisante pour garantir des performances raisonnables et la fiabilit√© de telles applications.\r\nL‚Äôobjectif de ce cours est donc de couvrir les techniques internes des syst√®mes de gestion de base de donn√©es (SGBD) qui sont responsables de l\'optimisation de l\'evaluation de requ√™tes SQL. Le cours pr√©sente premi√®rement l‚Äôarchitecture typique d\'un SGBD relationnel, puis examine en d√©tail les algorithmes et les structures de donn√©es utilis√©s pour impl√©menter les modules de cette architecture, y compris la gestion de la m√©moire permanente, la gestion de la m√©moire volatile, les structures de stockage, les m√©thodes d‚Äôacc√®s, et l\'optimisation de requ√™te bas√©e sur un modele de co√ªt d\'execution.\r\nLe cours comprend un certain nombre d\'exercices (TD) et d\'exercices pratiques (TP) dans lesquels les √©tudiants auront l\'occasion d\'explorer et de mettre en ≈ìuvre les fonctionnalit√©s de certains modules du SGBD. '),
(10, 'S1', 0, 'Syst√®mes d\'Information Avanc√©s', 'T. Jaillet', 40, 'Introduction aux syst√®mes d\'information avanc√©s.\r\n- Gestion de projet (3 s√©ances de 3 heures)\r\n- Gestion des exigences (une s√©ance )\r\n- Design Patterns (6 S√©ances). '),
(11, 'S1', 0, 'Syst√®mes et Algorithmes R√©partis', 'J. El Haddad', 40, 'Ce cours vise √† pr√©senter les concepts √©l√©mentaires des syst√®mes et les algorithmes associ√©s aux environnements r√©partis\r\nIntroduction aux syst√®mes r√©partis\r\n\r\nLes applications r√©parties s\'ex√©cutent sur un ensemble de machines connect√©es en r√©seau. Elles repr√©sentent un ensemble de composants qui coop√®rent pour r√©aliser un objectif commun en utilisant le r√©seau comme un moyen d\'√©changer des donn√©es. Ce cours vise √† pr√©senter les concepts √©l√©mentaires des syst√®mes et les algorithmes associ√©s aux environnements r√©partis\r\nIntroduction aux syst√®mes r√©partis\r\nPrincipe et fonctionnement des appels de proc√©dure √† distance (RPC)\r\nMise en ≈ìuvre de la communication √† distance en utilisant la couche r√©seaux (RMI) en Java,\r\nIntroduction √† l‚Äôalgorithmique r√©partie\r\nPr√©sentation du mod√®le de r√©partition bas√© sur les √©changes de messages\r\nPr√©sentation des concepts li√©s √† la communication: contr√¥le de flux, synchronisation de processus, relation de causalit√©, r√©seaux FIFO\r\nPr√©sentation des concepts li√©s au temps et √† la concurrence : horloges logiques, exclusion mutuelle. '),
(13, 'S1', 0, 'Droit', 'C. Ouampana', 18, 'Permettre aux √©tudiants de d√©couvrir les fondements du droit fran√ßais et de se familiariser avec les principaux concepts ainsi qu‚Äôavec les grandes classifications du droit positif afin de prendre conscience des sp√©cificit√©s du droit de l‚Äôentreprise.\r\nPr√©sentation du droit : organisation, sanction, r√©gulation\r\nNotions g√©n√©rales de base : droit priv√©/droit public, sujets/objets, droit imp√©ratif/droit suppl√©tif\r\nSources de droit : droit interne, droit europ√©en, droit international\r\nDroit de la preuve : modes de preuve, charge de la preuve, originalit√© du droit commercial par rapport au droit civil\r\nJustice en France : ordre judiciaire, ordre administratif, r√®gles de comp√©tences en mati√®re de droit des affaires\r\nDroit des contrats et responsabilit√© contractuelle : contrats d‚Äôaffaires Droit des soci√©t√©s : structure des entreprises\r\n√âtudes de cas '),
(15, 'S1', 0, 'Marketing', 'S. Lasri', 40, 'Familiariser les √©tudiants avec les concepts de marketing et leur permettre d\'avoir une vision critique sur le fonctionnement des march√©s, des entreprises et de leurs\r\nactions.\r\n\r\nPr√©sentation du marketing\r\nPr√©sentation de la d√©marche marketing\r\nLa strat√©gie marketing, de segmentation, de positionnement\r\nLes √©tudes et recherches en marketing, qualitatives, quantitatives\r\nLe comportement du consommateur\r\nLes politiques marketing, produit, de prix, de communication, de distribution\r\nLe marketing international\r\n√âtudes de cas '),
(17, 'S2', 0, 'Analyse financi√®re', 'E. Thibonnier', 60, 'Introduction de notions de comptabilit√©s g√©n√©rales et de math√©matiques financi√®res n√©cessaires √† l‚Äôanalyse financi√®re et pr√©sentation de l‚Äôanalyse du compte de r√©sultat et du bilan financier.\r\nCalcul financier : actualisation et capitalisation, analyse des emprunts et √©l√©ment pour la d√©cision de financement. Analyse du compte r√©sultat : les soldes interm√©diaires de gestion\r\n(SIG), la valeur ajout√©e, retraitement du cr√©dit-bail, le financement interne et la CAF.\r\nAnalyse de bilan financier - approche Liquidit√©/Exigibilit√© : l‚Äôaffectation du r√©sultat, retraitement du cr√©dit-bail, Le bilan r√©sum√©, la relation statique d‚Äô√©quilibre financier (T = FR ‚Äì BFR), la tr√©sorerie potentielle.\r\nM√©thode des ratios : les principes de l‚Äôanalyse par la m√©thode des ratios, les principaux ratios (structure du bilan, √©quilibre financier, gestion, marges), les ratios sp√©cifiques √† l‚Äôanalyse boursi√®re.\r\nAnalyse des flux financiers : la reconstitution des flux financiers, les emplois et les ressources, la construction d‚Äôun tableau de financement, la construction d‚Äôun tableau des flux de tr√©sorerie, interpr√©tation et analyse.\r\nAnalyse des rentabilit√©s : mesure comptable de la rentabilit√© √©conomique, mesure comptable de la rentabilit√© financi√®re, L‚Äôeffet de levier financier. '),
(19, 'S2', 0, 'Syst√®mes d\'Information Avanc√©s 2', 'T. Jaillet', 60, 'Apporter des compl√©ments en architecture et en urbanisation des syst√®mes d‚Äôinformation et mettre en application les concepts introduits au premier semestre en conduite de projet sous forme d‚Äôun projet men√© par √©quipe de 3 √† 4 √©tudiants. Architecture orient√© service (SOA)\r\nUrbanisme et processus m√©tier : introduction aux processus m√©tiers, les constats, les limites du fonctionnement en silo, quelques r√®gles de description des processus et des activit√©s, r√®gles de d√©coupage et niveau de maille, l‚Äôapport d‚Äôune d√©marche d‚Äôurbanisation au niveau m√©tier.\r\nLes r√©f√©rentiels dans l‚Äôurbanisation des SI\r\nOrganisation de la conduite d\'un projet informatique (PAQ, Estimation des charges, Planification...)\r\nApplication sous forme d‚Äôun projet qui s‚Äôeffectue dans les conditions semblables √† un projet informatique avec l\'utilisation d\'un Atelier G√©nie Logiciel et donnant lieu √† la remise de dossiers d\'analyse et de dossiers techniques ; r√©unions d\'avancement de projet, s√©ances de validation des choix fonctionnels et des orientations techniques, recette de l\'application. '),
(21, 'S2', 0, 'Ethique des donn√©es', 'I. Josnuar', 18, '\r\nObjectif de ce cours est de sensibiliser les √©tudiants au regard de techniques de manipulation et d‚Äôintroduire √† la probl√©matique de la protection et traitement des donn√©es et √† ses cons√©quences sur les individus.\r\n\r\nValidit√© des donn√©es et pi√®ges statistiques\r\nPropri√©t√© des donn√©es\r\nLes syst√®mes de r√©gulation de la protection des donn√©es\r\nLes textes applicables dans l\'Union europ√©enne et en France : les grands principes et d√©finitions juridiques de la protection des donn√©es √† caract√®re personnel\r\nNudge theory\r\nCons√©quences sur la soci√©t√© (privacy, surveillance, ‚Äôossification‚Äô‚Ä¶) '),
(24, 'S2', 0, 'Jeu d\'Entreprise', 'R. Cortes', 18, 'Application des concepts de l‚Äôanalyse financi√®re sur un logiciel de simulation.'),
(25, 'S2', 0, 'Organisation & Communication', 'F. Vatin', 30, 'Ce cours se donne pour objectif de permettre aux √©tudiants de :\r\n1) Comprendre et analyser le processus de changement et plus particul√®rement d\'innovation dans l\'organisation de l\'entreprise ;\r\n2) Comprendre et ma√Ætriser le m√©canisme de la communication li√©s au processus de changement ;\r\n3) Conduire efficacement des r√©unions et des n√©gociations dans un processus de changement\r\n\r\nCe cours comporte :\r\n1) Une partie \"sociologie\" qui d√©veloppe diff√©rents aspects du processus de changement dans l\'organisation et du processus ;\r\n2) Une partie \"communication\" qui pr√©sente et analyse diff√©rents types d\'interactions li√©s au processus de changement (conduite de r√©union, n√©gociation, gestion de conflit, etc...) '),
(27, 'S2', 0, 'Programmation Web', 'Raja Trabelsi', 40, 'Introduction to the construction of Web applications.\r\nThe main topic of this class is the construction of modern web applications. cover the following two topics:\r\nClient-side programming with javascript.\r\nServer-side programming with JSP and servlets.'),
(28, 'S2', 0, 'Anglais 2', 'K. Helme', 40, 'Fournir aux √©tudiants les outils linguistiques n√©cessaires pour fonctionner efficacement dans l\'entreprise et avec leurs partenaires europ√©ens.\r\nExpression orale / √©crite : anglais des affaires, faire un compte rendu oral en public, r√©diger, lettres, rapports, r√©sum√© de conf√©rences, r√©unions.\r\nPr√©paration au TOEIC : Test of English for International Communication.\r\nTraduction Economique : Familiariser les √©tudiants avec la terminologie √©conomique √† partir de th√®mes d\'actualit√©. Travail en laboratoire et/ou en salle audiovisuelle √† partir de documents authentiques. '),
(31, 'S2', 0, 'M√©moire', '-', 0, 'Pas de description pour cette UE.'),
(32, 'S2', 1, 'March√©s financiers', 'H. Portebello', 40, 'Connaissance g√©n√©rale des march√©s de capitaux (fonctionnement et raison d\'√™tre). Math√©matiques des calculs financiers. Initiation √† la mod√©lisation stochastique des march√©s et principaux r√©sultats de la th√©orie \"classique\".\r\nFinancement, risques et marche¬¥s de capitaux (actions, obligations, option, march√© mon√©taire, ...) Calculs actuariels classiques (taux, capitalisation, actualisation, duration, sensibilit√©, immunisation de portefeuille, ...)Mod√©lisation stochastique simplifi√©e du march√© action ( volatilit√©, \"beta\", corr√©lations, diversification, th√©orie du \"MEDAF\" et principaux r√©sultats, ...)\r\nAnalyse critique des mod√©lisations th√©oriques '),
(35, 'S2', 1, 'D√©cision multicrit√®re', 'L. Juplat', 40, 'Pr√©senter les principales familles de m√©thodes d‚Äôagr√©gation multicrit√®re existantes et mise en ≈ìuvre de telles m√©thodes dans des situations r√©elles de d√©cision.\r\nPr√©senter les principales familles de m√©thodes d‚Äôagr√©gation multicrit√®re existantes et mise en ≈ìuvre de telles m√©thodes dans des situations r√©elles de d√©cision.\r\nIntroduction au processus de d√©cision : actions, probl√©matique,\r\nMod√©lisation des pr√©f√©rences : vrai, quasi et pseudo crit√®res, structures associ√©es\r\nProc√©dures d‚Äôagr√©gation multicrit√®res de type crit√®re de synth√®se,\r\nProc√©dures d‚Äôagr√©gation multicrit√®res : relation de surclassement,\r\nPr√©sentation de la m√©thode programmation par objectif (goal programming)\r\nIllustration des m√©thodes sur le logiciel Electre. '),
(36, 'S2', 1, 'Ordonnancement et production', 'S. Kornman', 40, '\r\nCet enseignement a pour objet de sensibiliser les √©tudiants aux probl√©matiques de gestion de la production de biens et de services, en mettant en √©vidence la tr√®s grande complexit√© des probl√®mes √† r√©soudre et la difficult√© qui en d√©coule de piloter efficacement une cha√Æne logistique. Quelques grilles d‚Äôanalyse, mod√©lisations et instrumentations seront abord√©es.\r\nTypologie des probl√®mes de gestion de la production des biens et des services -Planification de la production : MRP2 Gestion des approvisionnements et des stocks : demande uniforme et certaine, demande al√©atoire : notions de rupture de stock, qualit√© de service, stock de s√©curit√© et ordonnancement de projets. Ordonnancement d‚Äôateliers : algorithmes optimaux et heuristiques. √âtude de cas impliquant, pour certains d‚Äôentre eux, l‚Äôusage de logiciels comme cplex et Excel solver. '),
(39, 'S2', 1, 'S√©curit√© & R√©seaux', 'H. Costantini', 40, 'Le cours porte sur les protocoles r√©seaux utilis√©s dans les couches hautes du mod√®le OSI, ainsi que sur les algorithmes de cryptographie qui permettent de les s√©curiser.\r\nRappels\r\nmod√®le OSI\r\nCouche r√©seau\r\nContr√¥le de congestion\r\nQualit√© de service\r\nInternet et IP');

